    data: |
      SELECT DISTINCT col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 + - - col2 + + - col0 * col1 * + col1 + - - col1 IS NOT NULL;
  - name: tab2

outputs:
  - name: q2319.out
    data: |
      23
      40
      58
